Rostral rectangular, height 37.9 % of width; incompletely divided dorsally by a Y-shaped shallow groove; bordered posterolaterally by first supralabials and naris, and dorsally by three postrostral scales (
Fig. 4C
); naris oval, bordered anteriorly by rostral, anterodorsally by one postrostral, posteriorly by five scales on right side and by six scales on left side, and ventrally by first supralabials; orbit separated from supralabials by single row of small lorilabial scales; 11 SuL on right and left side; 8 InfL on right and left side. Dorsal surface of head tuberculated, beginning between anterior margins of eyes, subpyramidal and gradually increasing in size toward the posterior margin of head that are subconical in form.

Mental triangular, length 89.7% of width; bordered laterally by first infralabials, posteriorly by one pair of enlarged first postmentals, which are in contact medially over 40.2% of their length; second postmentals smaller than first postmentals, hexagonal on right side and pentagonal on left side, with each about half the length of first postmentals, and separated from each other by three small granular scales (
Fig.4D
); gular scales small, granular, grading to slightly larger posteriorly.

Hind limbs longer than forelimbs, TibL 16.0% of SVL; dorsal surface of thigh and tibia covered by granular scales interspersed with larger, conical tubercles; scales on ventral surface of thigh and tibia smooth, flat, and subimbricate; enlarged precloacofemoral scales in continuous series; no precloacal depression; 24 precloacofemoral pores in wide Ʌ-shape arrangement; 5 rows of enlarged postprecloacal scales (
Fig.5A
); plantar scales slightly raised, juxtaposed; digits well-developed, inflected at basal metapodial-phalangeal joints, digits slightly narrower distal to inflection; subdigital scales transversely expanded along the entire length of each digit, but slightly compressed in both length and width immediately distal to interphalangeal inflection; 12 LamT1, 15 LamT2, 18 LamT3, 20 LamT4, and 18 LamT5; claws well-developed, sheathed by two dorsal scales and one ventral scale; relative length of toes IV>V> III> II> I.
